import React, { useState } from "react";
import { Link } from "react-router-dom";

const Header = () => {
  return (
    // Header Navbar Compnent
    <header className="header">
      {/* Logo Section */}
      <div className="logo">
        <Link to="/">
          {/* <img src={} alt="Logo" /> */}
          <h2>Poke Pedia</h2>
        </Link>
      </div>

      {/* Navbar Section */}
      <nav className="navbar">
        <Link to="/"></Link>
        <Link to="/"></Link>
        <Link to="/"></Link>
        <Link to="/"></Link>
      </nav>
    </header>
  );
};

export default Header;
